import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div class="naxbar-fixed">
        <nav>
          <div class="brand-logo center">
            <ul>
              <li class="active"><a href="/page1">page1</a></li>
              <li><a href="/page2">page2</a></li>
            </ul>
          </div>
        </nav>
      </div>
    </div>
  );
}

export default App;
